import {StyleSheet, View, Text, StatusBar, SafeAreaView, Image} from 'react-native'
import * as React from 'react';


export function Progress() {
    return (
      <SafeAreaView style={styles.container}>
        <View>            
            <Text>Progress</Text>
        </View>
      </SafeAreaView>
    );
  }

const styles = StyleSheet.create({
    container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center'
    }
});
